„TrenkTuras“ mob. programėlė skirta žygiavimui Solo žygių maršrutais. Prisijungę prie asmeninės paskyros galėsite užsiregistruoti į žygį, atsisiųsti Solo žygio maršruto žemėlapį, kuris žygio metu veiks ir be interneto. Taip pat matysite savo asmeninę statistiką, įveiktus bei artėjančius žygius.  Prenumeratoriai į visus žygius galės registruotis nemokamai, o taip pat galės atšaukti registraciją bei nemokamai pridėti iki 5-ių žygio draugų! 


Programėlės ypatumai:
1. Registracija į Solo žygius;
2. Navigavimas „offline“ režimu;
3. Du žygiavimo režimai: su GPS bei be GPS (baterijos taupymo režimas); 
4. Žygiavimo su įjungtu GPS privalumai: nueitų kilometrų skaičiavimas, nužygiuoto kelio brėžimas bei signalizavimas nukrypus nuo maršruto;
5. Asmeninė paskyra: artimiausio žygio informacija, įveiktų žygių sąrašas, visų nueitų kilometrų bei žygių statistika.

Išsirinkite norimą žygį ir keliaukite jau sukurtais maršrutais visoje Lietuvoje!


